	(4625, 522, 'section_3_scetion_3_advantages_0_description', 'Воздух забирается через отверстия с обеих сторон и выпускается через верхние и нижние отверстия скамейки для циркуляции воздуха и предотвращения запотевания внутри протектора.'),
