	(4847, 530, '_wp_page_template', 'articles-template2.php'),
	(4848, 530, 'section_1_text', 'Айкюа была разработана с целью облегчения и предотвращения симптомов сухого глаза, современного заболевания, которым может заболеть любой человек и людей, страдающих сенной лихорадкой. Обладая различными функциями, он защищает ваши глаза, обеспечивая удобство и безопасность.'),
	(4849, 530, '_section_1_text', 'field_604e57620a1fa'),
	(4850, 530, 'section_2_section_2_title', 'Сухость и защита глаз'),
	(4851, 530, '_section_2_section_2_title', 'field_604e58440a1fc'),
	(4852, 530, 'section_2_section_2_subtitle', 'Сухой глаз, послеоперационный период, АНТИ-PM2. 5... Вредная окружающая среда. Защитите и увлажните глаза с помощью очков EYECURE'),
	(4853, 530, '_section_2_section_2_subtitle', 'field_604e58520a1fd'),
	(4854, 530, 'section_2_section_2_image', '531'),
	(4855, 530, '_section_2_section_2_image', 'field_604e58690a1fe'),
	(4856, 530, 'section_2', ''),
	(4857, 530, '_section_2', 'field_604e57b70a1fb'),
	(4858, 530, 'section_3_section_3_title_1', 'PM2.5'),
	(4859, 530, '_section_3_section_3_title_1', 'field_604e58af6984e'),
	(4860, 530, 'section_3_section_3_description_2', 'Эти очки для слабовидящих людей , которые становятся чувствительными к свету в дополнение к симптомам потери зрения и нарушениям зрения, таким как глаукома и диабетическая ретинопатия.\r\n В обычных очках свет проникает сверху, снизу и сбоку, что снижает функцию светозащитных линз,\r\n но за счет использования непрозрачной боковой защитной подушки, входящий свет значительно блокируется.'),
	(4861, 530, '_section_3_section_3_description_2', 'field_604e5eb25053e'),
	(4862, 530, 'section_3_section_3_image_2', '548'),
	(4863, 530, '_section_3_section_3_image_2', 'field_604e5ec75053f'),
	(4864, 530, 'section_3_section_3_advantages_1_0_title', 'Сферическая двойная линза из поликарбоната'),
	(4865, 530, '_section_3_section_3_advantages_1_0_title', 'field_604e59e469852'),
	(4866, 530, 'section_3_section_3_advantages_1_0_description', 'Благодаря использованию мягкого и эластичного эластомера он мягко ложится на лицо и уменьшает попадание посторонних предметов извне. Его также можно мыть водой без обесцвечивания или порчи. Благодаря отражению цвета лица на полупрозрачной защитной.'),
	(4867, 530, '_section_3_section_3_advantages_1_0_description', 'field_604e59eb69853'),
	(4868, 530, 'section_3_section_3_advantages_1_0_image', '525'),
	(4869, 530, '_section_3_section_3_advantages_1_0_image', 'field_604e59fe69854'),
	(4870, 530, 'section_3_section_3_advantages_1_1_title', 'Предотвращает сухость глаз '),
	(4871, 530, '_section_3_section_3_advantages_1_1_title', 'field_604e59e469852'),
	(4872, 530, 'section_3_section_3_advantages_1_1_description', 'Впрыскивая воду в пакет для удержания воды и прикрепляя его,\r\nподдерживается влажность внутри рамы и предотвращается высыхание глаз.'),
	(4873, 530, '_section_3_section_3_advantages_1_1_description', 'field_604e59eb69853'),
	(4874, 530, 'section_3_section_3_advantages_1_1_image', '535'),
	(4875, 530, '_section_3_section_3_advantages_1_1_image', 'field_604e59fe69854'),
	(4876, 530, 'section_3_section_3_advantages_1_2_title', 'Защита от пыли и после операции'),
	(4877, 530, '_section_3_section_3_advantages_1_2_title', 'field_604e59e469852'),
	(4878, 530, 'section_3_section_3_advantages_1_2_description', 'Защитная подушечка предотвращает проникновение ветра, пыли, пыльцы и т. Д. ИХ также можно использовать после операции по удалению катаракты.\r\n'),
