	(4908, 530, 'section_5_section_5_description', '<p>Сравните зазор между лицом и капюшоном, если смотреть сверху. Узость щели настолько различается между <strong>EYES CURE</strong> (верхний рисунок) и стеклом от общего поллиноза (нижний рисунок). Вы можете увидеть высокую степень герметичности <strong>EYES CURE</strong>. Почему это имеет значение? Это связано с тем, что <strong>EYES  CURE</strong> разработана с учетом  особенностей лица с учетом характеристик материала. Это оправа, которая подходит к лицу,  сочетая не только форму лица, но также регулируемый гибкий резиновый дужек и форму мягкого и эластичного капюшона. Очки, не совпадающие по ширине с подушечкой для носа и переносицей, будет легче опустить, а при опускании очков зазор увеличится. Это самый важный момент для очков от сенной лихорадки и защитных очков.\r\n                                </p>\r\n                                <p>Сравнивая носовую подушечку <strong>EYES CURE</strong> (слева) и обычное стекло от сенной лихорадки (справа), вы можете видеть, что носовая подушечка <strong>EYES CURE</strong> сделана выше. Есть много продуктов, которые, кажется, предназначены для Европы и США  с низкой подушечкой для носа и широкой шириной носа для очков с общей сенной лихорадкой.\r\n                                </p>'),
	(4909, 530, '_section_5_section_5_description', 'field_604e5caf59dc3'),
	(4910, 530, 'section_5_section_5_advantages', '2'),
	(4911, 530, '_section_5_section_5_advantages', 'field_604e5ccf59dc4'),
	(4912, 530, 'section_5', ''),
	(4913, 530, '_section_5', 'field_604e5c7e59dc1'),
	(4914, 530, 'section_6_section_6_title', 'Сухой глаз'),
	(4915, 530, '_section_6_section_6_title', 'field_604e63908d2cb'),
	(4916, 530, 'section_6_section_6_subtitle', 'Сухой глаз  «Современная болезнь, которой может столкнуться каждый»'),
	(4917, 530, '_section_6_section_6_subtitle', 'field_604e63ad8d2cc'),
	(4918, 530, 'section_6_section_6_description', 'Из-за растущих шансов продолжать смотреть на экраны мобильных устройств, таких как персональные компьютеры, телевизоры и мобильные телефоны, увеличивается количество людей, которые неосознанно перегружают глаза и быстро устают или чувствуют себя некомфортно ... Сухие глаза и сухие глаза в последнее время участились как причины усталости глаз. Сухой глаз - это заболевание, при котором слезы недостаточно или их состав изменяется, вызывая такие повреждения, как царапины на поверхности глаз.'),
	(4919, 530, '_section_6_section_6_description', 'field_604e63bd8d2cd'),
	(4920, 530, 'section_6', ''),
	(4921, 530, '_section_6', 'field_604e636b5a7e2'),
	(4922, 530, 'section_7_section_7_title_1', 'О функции слезы'),
	(4923, 530, '_section_7_section_7_title_1', 'field_604e63de8d2cf'),
	(4924, 530, 'section_7_section_7_description', 'Слезы создают тонкую пленку на поверхности глаза при моргании, но в случае сухого глаза эту пленку невозможно восстановить даже путем моргания, и она становится похожей на дыру, и оттуда в глаз попадают инородные вещества и микробы. сказал, что становится легче и чаще вызывают различные глазные заболевания.'),
	(4925, 530, '_section_7_section_7_description', 'field_604e63f48d2d0'),
