	(4940, 530, 'section_8_section_8_subtitle_2', 'Если у Вас 5 или более симптомом, то скорее всего у Вас синдром «Сухой Глаз»'),
	(4941, 530, '_section_8_section_8_subtitle_2', 'field_604e6519dd74c'),
	(4942, 530, 'section_8_section_8_description', 'Если у вас много тревожных симптомов, не оставляйте их в покое, потому что вы можете это выдержать, и как можно скорее обратитесь к офтальмологу.'),
