	(5117, 530, '_section_8_section_8_list_11_line', 'field_604e650ddd74b'),
	(5118, 530, 'section_9_section_9_list_0_title', 'Тем, кто длительное время пользуется компьютером каждый день по работе и т. д.'),
	(5119, 530, '_section_9_section_9_list_0_title', 'field_604e65861d8d0'),
	(5120, 530, 'section_9_section_9_list_0_description', 'Если вы смотрите на экран, количество морганий резко уменьшится, и вы  не будете полностью защищены от слез.'),
	(5121, 530, '_section_9_section_9_list_0_description', 'field_604e658f1d8d1'),
	(5122, 530, 'section_9_section_9_list_1_title', 'Тем, кто носит контактные линзы'),
	(5123, 530, '_section_9_section_9_list_1_title', 'field_604e65861d8d0'),
	(5124, 530, 'section_9_section_9_list_1_description', 'Кажется, что глаза высыхают чаще, чем у тех, кто не пользуется контактными линзами.'),
	(5125, 530, '_section_9_section_9_list_1_description', 'field_604e658f1d8d1'),
	(5126, 530, 'section_9_section_9_list_2_title', 'Тем, кто пользуется кондиционером давно.'),
	(5127, 530, '_section_9_section_9_list_2_title', 'field_604e65861d8d0'),
	(5128, 530, 'section_9_section_9_list_2_description', 'При длительном использовании кондиционер сушит воздух в помещении (особенно нагревает) и сушит не только кожу, но и глаза.'),
	(5129, 530, '_section_9_section_9_list_2_description', 'field_604e658f1d8d1'),
	(5130, 530, 'section_9_section_9_list_3_title', 'Люди с сенной лихорадкой'),
	(5131, 530, '_section_9_section_9_list_3_title', 'field_604e65861d8d0'),
	(5132, 530, 'section_9_section_9_list_3_description', 'Говорят, что эти два заболевания имеют общие симптомы, такие как «зуд в глазах», «красные глаза» и «ощущение инородного тела», и могут быть связаны друг с другом.'),
	(5133, 530, '_section_9_section_9_list_3_description', 'field_604e658f1d8d1'),
	(5134, 530, 'section_9_section_9_list_4_title', 'Тем, кто регулярно ездит подолгу.'),
	(5135, 530, '_section_9_section_9_list_4_title', 'field_604e65861d8d0'),
	(5136, 530, 'section_9_section_9_list_4_description', 'Снижение мерцания из-за визуального напряжения и сухости в помещении из-за автомобильных кондиционеров может привести к сухости глаз.'),
	(5137, 530, '_section_9_section_9_list_4_description', 'field_604e658f1d8d1'),
	(5138, 530, 'section_10_section_10_list_0_title', 'Если устают глаза, давайте отдохнем.'),
	(5139, 530, '_section_10_section_10_list_0_title', 'field_604e65a81d8d5'),
	(5140, 530, 'section_10_section_10_list_0_description', 'Положите пропаренное полотенце на закрытые веки примерно на 5 минут, чтобы согреть глаза и улучшить кровообращение в глазах. Поочередно смотрите вдаль и поблизости и двигайте глазами, чтобы снять напряжение в глазах.'),
	(5141, 530, '_section_10_section_10_list_0_description', 'field_604e65a81d8d6'),
	(5142, 530, 'section_10_section_10_list_1_title', 'Предотвратить высыхание слез.'),
	(5143, 530, '_section_10_section_10_list_1_title', 'field_604e65a81d8d5'),
	(5144, 530, 'section_10_section_10_list_1_description', 'Сознательно увеличивайте количество миганий. Умеренно применять глазные капли. (Если вы используете слишком много глазных капель, они могут высохнуть.)'),
	(5145, 530, '_section_10_section_10_list_1_description', 'field_604e65a81d8d6'),
	(5146, 530, 'section_10_section_10_list_2_title', 'Не допускайте высыхания комнаты.'),
	(5147, 530, '_section_10_section_10_list_2_title', 'field_604e65a81d8d5'),
	(5148, 530, 'section_10_section_10_list_2_description', 'Помещения с кондиционерами часто бывают сухими, поэтому поддерживайте влажность с помощью увлажнителя.\r\nКроме того, избегайте попадания ветра кондиционера.'),
	(5149, 530, '_section_10_section_10_list_2_description', 'field_604e65a81d8d6'),
	(5150, 530, 'section_10_section_10_list_3_title', 'При использовании контактных линз следуйте инструкциям офтальмолога.'),
	(5151, 530, '_section_10_section_10_list_3_title', 'field_604e65a81d8d5'),
	(5152, 530, 'section_10_section_10_list_3_description', 'Лучше избегать использования контактных линз, поскольку они не могут поставлять свежие слезы при покрытой роговице. Также эффективно носить очки при сухости глаз.'),
	(5153, 530, '_section_10_section_10_list_3_description', 'field_604e65a81d8d6'),
	(5154, 530, 'section_3_section_3_bgmage_2', '917'),
	(5155, 530, '_section_3_section_3_bgmage_2', 'field_604e599869850'),
	(5156, 530, 'section_11_title', 'Каталог'),
	(5157, 530, '_section_11_title', 'field_60774ae61b437'),
	(5158, 566, '_edit_last', '1'),
	(5159, 566, '_wp_page_template', 'articles-template3.php'),
	(5160, 566, 'section_1_text', 'Очки незаменимы для предотвращения снега и ветра, а также для «обеспечения видимости» и «защиты глаз», например, от ультрафиолетовых лучей, вредных для глаз и внешних ударов. Как чисто отечественный бренд Axe разрабатывает очки, которые по форме соответствуют форме японского лица.'),
	(5161, 566, '_section_1_text', 'field_604e737b0411b'),
	(5162, 566, 'section_2_section_2_title', 'Описание значков'),
	(5163, 566, '_section_2_section_2_title', 'field_604e740d0411d'),
	(5164, 566, 'section_2_section_2_subtitle', '* ОБЯЗАТЕЛЬНО ПРОВЕРЬТЕ СООТВЕТСТВИЕ ТОВАРА ПЕРЕД ПОКУПКОЙ ЗАЩИТНЫХ ОЧКОВ ДЛЯ ОЧКОВ И КАСКИ!'),
	(5165, 566, '_section_2_section_2_subtitle', 'field_604e74390411e'),
	(5166, 566, 'section_2_section_2_list', '4'),
	(5167, 566, '_section_2_section_2_list', 'field_604e74670411f'),
	(5168, 566, 'section_2', ''),
	(5169, 566, '_section_2', 'field_604e73f00411c'),
	(5170, 566, 'section_3_section_3_title', 'Линза панораманого вида'),
	(5171, 566, '_section_3_section_3_title', 'field_604e7512b647f'),
	(5172, 566, 'section_3_section_3_image', '607'),
	(5173, 566, '_section_3_section_3_image', 'field_604e751db6480'),
	(5174, 566, 'section_3_section_3_description', 'Недавно разработанный и недавно разработанный асферический широкоугольный объектив [объектив для панорамного обзора], который огибает объектив сбоку и обеспечивает широкое поле зрения 180 градусов и более. Используя три разные изогнутые поверхности для линз, нам удалось подавить искажение поля зрения и приблизить расстояние между глазами и линзой. В результате улучшилась видимость * и повысилась безопасность. Расширяя свой кругозор, у вас также появляется больше возможностей для катания.'),
	(5175, 566, '_section_3_section_3_description', 'field_604e752ab6481'),
	(5176, 566, 'section_3', ''),
	(5177, 566, '_section_3', 'field_604e74deb647e'),
	(5178, 566, 'section_4_section_4_title_1', 'Обычные линзы'),
	(5179, 566, '_section_4_section_4_title_1', 'field_604e7558b6483'),
	(5180, 566, 'section_4_section_4_images_1', 'a:2:{i:0;s:3:"613";i:1;s:3:"614";}'),
	(5181, 566, '_section_4_section_4_images_1', 'field_604e7574b6484'),
	(5182, 566, 'section_4_section_4_title_2', 'ПАНОРАМНЫЕ ЛИНЗЫ'),
	(5183, 566, '_section_4_section_4_title_2', 'field_604e758bb6485'),
	(5184, 566, 'section_4_section_4_images_2', 'a:2:{i:0;s:3:"615";i:1;s:3:"616";}'),
	(5185, 566, '_section_4_section_4_images_2', 'field_604e7596b6486'),
	(5186, 566, 'section_4', ''),
	(5187, 566, '_section_4', 'field_604e7546b6482'),
	(5188, 566, 'section_5_section_5_title_1', 'ТОНКИЕ'),
	(5189, 566, '_section_5_section_5_title_1', 'field_604f0df3a83d6'),
	(5190, 566, 'section_5_section_5_description_1', 'Асферический широкоугольный объектив, состоящий из трех изогнутых поверхностей разной кривизны. Он тоньше и легче сферической линзы, использующей одну изогнутую поверхность с той же скоростью. Теперь можно создать более стильный дизайн, чем обычные защитные очки для очков.'),
