	(5391, 566, 'section_5_0_section_5_title_1', 'ТОНКИЕ'),
	(5392, 566, '_section_5_0_section_5_title_1', 'field_604f0df3a83d6'),
	(5393, 566, 'section_5_0_section_5_description_1', 'Асферический широкоугольный объектив, состоящий из трех изогнутых поверхностей разной кривизны. Он тоньше и легче сферической линзы, использующей одну изогнутую поверхность с той же скоростью. Теперь можно создать более стильный дизайн, чем обычные защитные очки для очков.'),
	(5394, 566, '_section_5_0_section_5_description_1', 'field_604f0e27a83d7'),
	(5395, 566, 'section_5_0_section_5_image_1', '617'),
	(5396, 566, '_section_5_0_section_5_image_1', 'field_604f0e34a83d8'),
	(5397, 566, 'section_5_1_section_5_title_1', 'СОВМЕСТИМ С БОЛЬШИМИ ОЧКАМИ'),
	(5398, 566, '_section_5_1_section_5_title_1', 'field_604f0df3a83d6'),
	(5399, 566, 'section_5_1_section_5_description_1', 'Обычные очки для очков имеют толстую оправу, поэтому очки не задевают линзу, что делает поле зрения узким. Оригинальные линзы AXE [Panoramic View Lens] подходят как для тонких, так и для больших очков с высотой 50 мм и 150 мм для левой и правой сторон.'),
	(5400, 566, '_section_5_1_section_5_description_1', 'field_604f0e27a83d7'),
	(5401, 566, 'section_5_1_section_5_image_1', '618'),
	(5402, 566, '_section_5_1_section_5_image_1', 'field_604f0e34a83d8'),
	(5403, 566, 'section_8_section_7_list_0_title', 'Сферическая двойная линза из поликарбоната'),
	(5404, 566, '_section_8_section_7_list_0_title', 'field_604f4d2dfb534'),
	(5405, 566, 'section_8_section_7_list_0_description', 'Сферическая линза из поликарбоната с отличной ударопрочностью, созданная благодаря строгим условиям формования, не допускающим искажений. Сферическая поверхность увеличивает воздухопроницаемость очков, а двойные линзы улучшают эффект запотевания. Кроме того, широкое поле зрения в вертикальном и горизонтальном направлениях несравнимо с другими объективами.'),
	(5406, 566, '_section_8_section_7_list_0_description', 'field_604f4d36fb535'),
	(5407, 566, 'section_8_section_7_list_0_image', '621'),
	(5408, 566, '_section_8_section_7_list_0_image', 'field_604f4d52fb536'),
	(5409, 566, 'section_8_section_7_list_1_title', 'УФ защита'),
	(5410, 566, '_section_8_section_7_list_1_title', 'field_604f4d2dfb534'),
	(5411, 566, 'section_8_section_7_list_1_description', 'Во всех продуктах Snow Goggles используются линзы для защиты от ультрафиолета, которые блокируют 99,9% и более вредных ультрафиолетовых лучей.'),
	(5412, 566, '_section_8_section_7_list_1_description', 'field_604f4d36fb535'),
	(5413, 566, 'section_8_section_7_list_1_image', '622'),
	(5414, 566, '_section_8_section_7_list_1_image', 'field_604f4d52fb536'),
	(5415, 566, 'section_8_section_7_list_2_title', 'Многоугольная система'),
	(5416, 566, '_section_8_section_7_list_2_title', 'field_604f4d2dfb534'),
	(5417, 566, 'section_8_section_7_list_2_description', 'Гибкое движение шарнира ремня делает его идеальным для лица любого гонщика, независимо от того, где он надет. Комфортная посадка достигается независимо от толщины и формы шлема или шапки.'),
	(5418, 566, '_section_8_section_7_list_2_description', 'field_604f4d36fb535'),
	(5419, 566, 'section_8_section_7_list_2_image', '623'),
	(5420, 566, '_section_8_section_7_list_2_image', 'field_604f4d52fb536'),
	(5421, 566, 'section_8_section_7_list_3_title', 'Двойной регулируемый ремешок'),
	(5422, 566, '_section_8_section_7_list_3_title', 'field_604f4d2dfb534'),
	(5423, 566, 'section_8_section_7_list_3_description', 'К левому и правому ремню прикреплены регуляторы, регулирующие длину ремня. Крючковую часть можно установить в центре затылка, обеспечивая удобную посадку.'),
	(5424, 566, '_section_8_section_7_list_3_description', 'field_604f4d36fb535'),
	(5425, 566, 'section_8_section_7_list_3_image', '624'),
	(5426, 566, '_section_8_section_7_list_3_image', 'field_604f4d52fb536'),
	(5427, 566, 'section_8_section_7_list_4_title', 'Верхняя вентиляция'),
	(5428, 566, '_section_8_section_7_list_4_title', 'field_604f4d2dfb534'),
	(5429, 566, 'section_8_section_7_list_4_description', 'Отверстие наверху и воздушная нагрузка обеспечивают максимальный приток воздуха при сохранении общей формы. Он всегда предотвращает запотевание линз и сохраняет хороший обзор.'),
	(5430, 566, '_section_8_section_7_list_4_description', 'field_604f4d36fb535'),
	(5431, 566, 'section_8_section_7_list_4_image', '625'),
	(5432, 566, '_section_8_section_7_list_4_image', 'field_604f4d52fb536'),
	(5433, 566, 'section_8_section_7_list_5_title', 'Объективная модель'),
	(5434, 566, '_section_8_section_7_list_5_title', 'field_604f4d2dfb534'),
	(5435, 566, 'section_8_section_7_list_5_description', 'Широкий дизайн, позволяющий плавно устанавливать очки, сохраняя при этом спортивный вид. Обеспечивается четкий обзор при сохранении ощущения использования очков. Удобная посадка без дискомфорта.'),
	(5436, 566, '_section_8_section_7_list_5_description', 'field_604f4d36fb535'),
	(5437, 566, 'section_8_section_7_list_5_image', '626'),
	(5438, 566, '_section_8_section_7_list_5_image', 'field_604f4d52fb536'),
	(5439, 566, 'section_8_section_7_list_6_title', 'Боковая вентиляция'),
	(5440, 566, '_section_8_section_7_list_6_title', 'field_604f4d2dfb534'),
	(5441, 566, 'section_8_section_7_list_6_description', 'Вентилятор устанавливается прямо сбоку, что не закрывает обзор, а воздушный поток внутри очков контролируется. Забирает свежий наружный воздух и выпускает теплый и влажный внутренний воздух. Он контролирует идеальный воздушный поток и предотвращает запотевание.'),
	(5442, 566, '_section_8_section_7_list_6_description', 'field_604f4d36fb535'),
	(5443, 566, 'section_8_section_7_list_6_image', '627'),
	(5444, 566, '_section_8_section_7_list_6_image', 'field_604f4d52fb536'),
	(5445, 566, 'section_8_section_7_list_7_title', 'Боковая вентиляция'),
	(5446, 566, '_section_8_section_7_list_7_title', 'field_604f4d2dfb534'),
	(5447, 566, 'section_8_section_7_list_7_description', 'Ремень изготовлен из водоотталкивающих волокон, которые отталкивают влагу, такую ​​как снег и дождь, и сохраняют эластичность. Поскольку ремень трудно намокнуть, его прочность повышается, и его трудно перекручивать.'),
	(5448, 566, '_section_8_section_7_list_7_description', 'field_604f4d36fb535'),
	(5449, 566, 'section_8_section_7_list_7_image', '620'),
	(5450, 566, '_section_8_section_7_list_7_image', 'field_604f4d52fb536'),
	(5451, 566, 'section_9_title', 'Каталог'),
	(5452, 566, '_section_9_title', 'field_6077599f4a77c'),
