	(5663, 638, 'section_6_section_6_title', 'Стандарт JIS для поляризационных линз солнцезащитных очков'),
	(5664, 638, '_section_6_section_6_title', 'field_604f5639309a3'),
	(5665, 638, 'section_6_section_6_left', 'Степень поляризации 90% или более → Поляризационная линза Степень поляризации 90% или меньше → линза с функцией поляризации'),
	(5666, 638, '_section_6_section_6_left', 'field_604f5643309a4'),
	(5667, 638, 'section_6_section_6_right', 'Когда степень поляризации падает ниже 90% и значение уменьшается, точность отсечения диффузного отражения снижается. Поляризованные солнцезащитные очки Axe - это высокоэффективные солнцезащитные очки, в которых используется степень поляризации 90% или более в соответствии со стандартами JIS.'),
