	(5686, 638, 'section_2_section_2_list_0_title', 'UV 400'),
	(5687, 638, '_section_2_section_2_list_0_title', 'field_604f52fa82eb0'),
	(5688, 638, 'section_2_section_2_list_0_description', 'Полноценная версия защиты от ультрафиолета. Помимо ультрафиолетовых лучей, он отсекает волны длиной около 400 нм, которые вредны для глаз.'),
