	(5693, 645, '_wp_attachment_metadata', 'a:5:{s:5:"width";i:76;s:6:"height";i:76;s:4:"file";s:21:"2021/04/Group-254.png";s:5:"sizes";a:0:{}s:10:"image_meta";a:12:{s:8:"aperture";s:1:"0";s:6:"credit";s:0:"";s:6:"camera";s:0:"";s:7:"caption";s:0:"";s:17:"created_timestamp";s:1:"0";s:9:"copyright";s:0:"";s:12:"focal_length";s:1:"0";s:3:"iso";s:1:"0";s:13:"shutter_speed";s:1:"0";s:5:"title";s:0:"";s:11:"orientation";s:1:"0";s:8:"keywords";a:0:{}}}'),
	(5694, 638, 'section_2_section_2_list_1_title', ''),
	(5695, 638, '_section_2_section_2_list_1_title', 'field_604f52fa82eb0'),
	(5696, 638, 'section_2_section_2_list_1_description', 'Это числовое значение точности отсечения рассеянного отражения от поверхности дороги и воды. Чем выше значение, тем больше сокращается диффузное отражение.'),
	(5697, 638, '_section_2_section_2_list_1_description', 'field_604f530582eb1'),
	(5698, 638, 'section_2_section_2_list_1_image', '642'),
	(5699, 638, '_section_2_section_2_list_1_image', 'field_604f530f82eb2'),
	(5700, 638, 'section_2_section_2_list_2_title', ''),
	(5701, 638, '_section_2_section_2_list_2_title', 'field_604f52fa82eb0'),
	(5702, 638, 'section_2_section_2_list_2_description', 'Это числовое значение количества света, проходящего через линзу. Чем выше число, тем ярче будет свет.'),
	(5703, 638, '_section_2_section_2_list_2_description', 'field_604f530582eb1'),
	(5704, 638, 'section_2_section_2_list_2_image', '643'),
	(5705, 638, '_section_2_section_2_list_2_image', 'field_604f530f82eb2'),
	(5706, 638, 'section_2_section_2_list_3_title', ''),
	(5707, 638, '_section_2_section_2_list_3_title', 'field_604f52fa82eb0'),
	(5708, 638, 'section_2_section_2_list_3_description', 'Это числовое значение точности отсечения синего света с длиной волны от 380 до 495 нм, который достигает сетчатки глаза. Размеры топора основаны на 450 нм.'),
	(5709, 638, '_section_2_section_2_list_3_description', 'field_604f530582eb1'),
	(5710, 638, 'section_2_section_2_list_3_image', '644'),
	(5711, 638, '_section_2_section_2_list_3_image', 'field_604f530f82eb2'),
	(5712, 638, 'section_3_section_3_list_0_title', 'УФ ЗАЩИТА'),
	(5713, 638, '_section_3_section_3_list_0_title', 'field_604f53d08c0d8'),
	(5714, 638, 'section_3_section_3_list_0_description', 'Солнцезащитные очки Axe с УФ-вырезом, которые входят в стандартную комплектацию всех продуктов. Он блокирует ультрафиолетовые лучи, вредные для роговицы и сетчатки глаза.'),
	(5715, 638, '_section_3_section_3_list_0_description', 'field_604f53da8c0d9'),
	(5716, 638, 'section_3_section_3_list_0_image', '588'),
	(5717, 638, '_section_3_section_3_list_0_image', 'field_604f53f68c0da'),
	(5718, 638, 'section_3_section_3_list_1_title', 'ПОЛЯРИЗАЦИОННЫЕ ЛИНЗЫ'),
	(5719, 638, '_section_3_section_3_list_1_title', 'field_604f53d08c0d8'),
	(5720, 638, 'section_3_section_3_list_1_description', 'Он предотвращает рассеянное отражение, которое обычно возникает на поверхности дороги или воды. Он подходит для использования в сценах, где блики из-за отражения являются проблемой, например, рыбалка или вождение автомобиля.'),
	(5721, 638, '_section_3_section_3_list_1_description', 'field_604f53da8c0d9'),
	(5722, 638, 'section_3_section_3_list_1_image', '599'),
	(5723, 638, '_section_3_section_3_list_1_image', 'field_604f53f68c0da'),
	(5724, 638, 'section_3_section_3_list_2_title', 'АСФЕРИЧЕСКИЕ ЛИНЗЫ (10Х4,5)'),
	(5725, 638, '_section_3_section_3_list_2_title', 'field_604f53d08c0d8'),
	(5726, 638, 'section_3_section_3_list_2_description', 'Линза с высокой кривизной, которая использует кривизну 10 x 4,5. Благодаря широкой конструкции, охватывающей ваши виски, вы можете получить широкий угол обзора.'),
	(5727, 638, '_section_3_section_3_list_2_description', 'field_604f53da8c0d9'),
	(5728, 638, 'section_3_section_3_list_2_image', '592'),
	(5729, 638, '_section_3_section_3_list_2_image', 'field_604f53f68c0da'),
	(5730, 638, 'section_3_section_3_list_3_title', 'ПРУЖИННЫЙ ШАРНИР'),
	(5731, 638, '_section_3_section_3_list_3_title', 'field_604f53d08c0d8'),
	(5732, 638, 'section_3_section_3_list_3_description', 'Благодаря включению пружины в изогнутую часть рамы устраняется ощущение затягивания при ношении, а рама расширяется в соответствии с головой, улучшая посадку.'),
	(5733, 638, '_section_3_section_3_list_3_description', 'field_604f53da8c0d9'),
	(5734, 638, 'section_3_section_3_list_3_image', '595'),
	(5735, 638, '_section_3_section_3_list_3_image', 'field_604f53f68c0da'),
	(5736, 638, 'section_3_section_3_list_4_title', 'ГИБКИЙ РЕЗИНОВЫЙ ЗАУШНИК'),
	(5737, 638, '_section_3_section_3_list_4_title', 'field_604f53d08c0d8'),
	(5738, 638, 'section_3_section_3_list_4_description', 'Используя гибкий материал основы на конце оправы, вы можете отрегулировать угол и изгиб в соответствии с вашими ушами.'),
	(5739, 638, '_section_3_section_3_list_4_description', 'field_604f53da8c0d9'),
	(5740, 638, 'section_3_section_3_list_4_image', '589'),
	(5741, 638, '_section_3_section_3_list_4_image', 'field_604f53f68c0da'),
	(5742, 638, 'section_3_section_3_list_5_title', 'НЕСКОЛЬЗЯЩИЙ ВИСОК'),
	(5743, 638, '_section_3_section_3_list_5_title', 'field_604f53d08c0d8'),
	(5744, 638, 'section_3_section_3_list_5_description', 'На кончике виска заделан резиновый материал. В результате он не смещается даже во время напряженных движений или потоотделения.'),
	(5745, 638, '_section_3_section_3_list_5_description', 'field_604f53da8c0d9'),
	(5746, 638, 'section_3_section_3_list_5_image', '591'),
	(5747, 638, '_section_3_section_3_list_5_image', 'field_604f53f68c0da'),
	(5748, 638, 'section_3_section_3_list_6_title', 'ГИБКАЯ НОСОВАЯ ПОДУШКА'),
	(5749, 638, '_section_3_section_3_list_6_title', 'field_604f53d08c0d8'),
	(5750, 638, 'section_3_section_3_list_6_description', 'Используя гибкий материал, вы можете отрегулировать угол и ширину в соответствии с шириной вашего носа.'),
	(5751, 638, '_section_3_section_3_list_6_description', 'field_604f53da8c0d9'),
	(5752, 638, 'section_3_section_3_list_6_image', '593'),
	(5753, 638, '_section_3_section_3_list_6_image', 'field_604f53f68c0da'),
	(5754, 638, 'section_3_section_3_list_7_title', 'УКЛАДЫВАТЬСЯ НА СТЕКЛО'),
	(5755, 638, '_section_3_section_3_list_7_title', 'field_604f53d08c0d8'),
	(5756, 638, 'section_3_section_3_list_7_description', 'Солнцезащитные очки, которые можно носить поверх очков. Линза, которая выдвигается вверх и по бокам, не пропускает ветер и пыль. Он также идеально подходит для защиты от пыльцы.'),
	(5757, 638, '_section_3_section_3_list_7_description', 'field_604f53da8c0d9'),
	(5758, 638, 'section_3_section_3_list_7_image', '580'),
	(5759, 638, '_section_3_section_3_list_7_image', 'field_604f53f68c0da'),
	(5760, 638, 'section_3_section_3_list_8_title', 'ОПТИЧЕСКИЕ ЛИНЗЫ'),
	(5761, 638, '_section_3_section_3_list_8_title', 'field_604f53d08c0d8'),
	(5762, 638, 'section_3_section_3_list_8_description', 'В дополнение к обычным солнцезащитным очкам вы можете изготовить солнцезащитные очки по рецепту, непосредственно прикрепив линзы по рецепту.'),
	(5763, 638, '_section_3_section_3_list_8_description', 'field_604f53da8c0d9'),
	(5764, 638, 'section_3_section_3_list_8_image', '582'),
	(5765, 638, '_section_3_section_3_list_8_image', 'field_604f53f68c0da'),
	(5766, 638, 'section_3_section_3_list_9_title', 'ВНУТРЕННИЙ КАРКАС'),
	(5767, 638, '_section_3_section_3_list_9_title', 'field_604f53d08c0d8'),
	(5768, 638, 'section_3_section_3_list_9_description', 'Солнцезащитные очки с внутренней оправой для линз по рецепту. Съемный.'),
	(5769, 638, '_section_3_section_3_list_9_description', 'field_604f53da8c0d9'),
	(5770, 638, 'section_3_section_3_list_9_image', '580'),
	(5771, 638, '_section_3_section_3_list_9_image', 'field_604f53f68c0da'),
	(5772, 638, 'section_4_section_4_list_0_title', 'PS'),
	(5773, 638, '_section_4_section_4_list_0_title', 'field_604f54963099a'),
	(5774, 638, 'section_4_section_4_list_0_description', 'Высококачественный легкий объектив, обладающий исключительной ударопрочностью в любых условиях, от низких до высоких температур.'),
	(5775, 638, '_section_4_section_4_list_0_description', 'field_604f54a13099b'),
	(5776, 638, 'section_4_section_4_list_1_title', 'РЕЗИНОВЫЙ БАЛАНС'),
	(5777, 638, '_section_4_section_4_list_1_title', 'field_604f54963099a'),
	(5778, 638, 'section_4_section_4_list_1_description', 'На кончике виска используется каучуковый материал. Обладая стабильной посадкой, он выдерживает большие нагрузки и снижает стресс, вызванный длительным ношением.'),
	(5779, 638, '_section_4_section_4_list_1_description', 'field_604f54a13099b'),
	(5780, 638, 'section_4_section_4_list_2_title', 'ЖЕСТКАЯ НЕЙЛОНОВАЯ РАМА TR-90'),
	(5781, 638, '_section_4_section_4_list_2_title', 'field_604f54963099a'),
	(5782, 638, 'section_4_section_4_list_2_description', 'На кончике виска используется каучуковый материал. Обладая стабильной посадкой, он выдерживает большие нагрузки и снижает стресс, вызванный длительным ношением.'),
	(5783, 638, '_section_4_section_4_list_2_description', 'field_604f54a13099b'),
	(5784, 638, 'section_4_section_4_list_3_title', 'АЛЮМИНИВАЯ РАМА'),
	(5785, 638, '_section_4_section_4_list_3_title', 'field_604f54963099a'),
	(5786, 638, 'section_4_section_4_list_3_description', 'Легкая и высокоточная рама, отлитая из алюминия. Достигает объемной формы и удивительной легкости.'),
	(5787, 638, '_section_4_section_4_list_3_description', 'field_604f54a13099b'),
	(5788, 638, 'section_4_section_4_list_4_title', 'ТИТАНОВАЯ РАМА'),
	(5789, 638, '_section_4_section_4_list_4_title', 'field_604f54963099a'),
	(5790, 638, 'section_4_section_4_list_4_description', 'Обладая невероятной легкостью по сравнению с железом, он обладает превосходной устойчивостью к коррозии и аллергии благодаря своим характеристикам, и это материал, который нелегко вызывает усталость металла и может использоваться в течение многих лет.'),
	(5791, 638, '_section_4_section_4_list_4_description', 'field_604f54a13099b'),
	(5792, 638, 'section_4_section_4_list_5_title', 'FC-E'),
	(5793, 638, '_section_4_section_4_list_5_title', 'field_604f54963099a'),
	(5794, 638, 'section_4_section_4_list_5_description', 'Имеет антибликовое покрытие. Покрытие AR устраняет неприятные отражения, попадающие на заднюю часть объектива, и обеспечивает удобный обзор.'),
	(5795, 638, '_section_4_section_4_list_5_description', 'field_604f54a13099b'),
	(5796, 638, 'section_4_section_4_list_6_title', 'CR-39L'),
	(5797, 638, '_section_4_section_4_list_6_title', 'field_604f54963099a'),
	(5798, 638, 'section_4_section_4_list_6_description', 'Это материал, который обычно используется в качестве линз для очков. Он устойчив к царапинам, имеет высокую прозрачность и очень мало искажает объект, поэтому это линзы, которые не нагружают глаза. Он также обладает отличной химической стойкостью к средствам для укладки волос.'),
	(5799, 638, '_section_4_section_4_list_6_description', 'field_604f54a13099b'),
	(5800, 638, 'section_4_section_4_list_7_title', 'ОБОД NUROL'),
	(5801, 638, '_section_4_section_4_list_7_title', 'field_604f54963099a'),
	(5802, 638, 'section_4_section_4_list_7_description', 'Это деталь, используемая для крепления линзы по рецепту. Его можно не только использовать как солнцезащитные очки, но и как солнцезащитные очки по рецепту.'),
	(5803, 638, '_section_4_section_4_list_7_description', 'field_604f54a13099b'),
	(5804, 638, 'section_4_section_4_list_8_title', 'ЛЕГКОЕ ЗАКАЛЕННОЕ СТЕКЛО'),
	(5805, 638, '_section_4_section_4_list_8_title', 'field_604f54963099a'),
	(5806, 638, 'section_4_section_4_list_8_description', 'Это деталь, используемая для крепления линзы по рецепту. Его можно не только использовать как солнцезащитные очки, но и как солнцезащитные очки по рецепту.'),
	(5807, 638, '_section_4_section_4_list_8_description', 'field_604f54a13099b'),
	(5808, 638, 'section_5_section_5_list_0_title', 'Подушечки для носа'),
	(5809, 638, '_section_5_section_5_list_0_title', 'field_604f55e43099f'),
	(5810, 638, 'section_5_section_5_list_0_description', 'Эта деталь, которая с двух сторон зажимает нос и фиксирует положение солнцезащитных очков и очков.'),
	(5811, 638, '_section_5_section_5_list_0_description', 'field_604f55f0309a0'),
	(5812, 638, 'section_5_section_5_list_0_image', ''),
	(5813, 638, '_section_5_section_5_list_0_image', 'field_604f5601309a1'),
	(5814, 638, 'section_5_section_5_list_1_title', 'Обод'),
	(5815, 638, '_section_5_section_5_list_1_title', 'field_604f55e43099f'),
	(5816, 638, 'section_5_section_5_list_1_description', 'Детали, окружающие линзы. Обычно на внутренней стороне оправы есть канавка, называемая проволокой для крепления линзы.'),
	(5817, 638, '_section_5_section_5_list_1_description', 'field_604f55f0309a0'),
