	(5821, 638, '_section_5_section_5_list_2_title', 'field_604f55e43099f'),
	(5822, 638, 'section_5_section_5_list_2_description', 'Подвижная часть для складывания височной части, иногда называемая шарниром. Тип с использованием винтов распространен.'),
	(5823, 638, '_section_5_section_5_list_2_description', 'field_604f55f0309a0'),
