	(638, 1, '2021-04-15 10:54:51', '2021-04-15 07:54:51', 'Более агрессивный и веселый. Для тех, кто любит каждый день, AXе всегда предлагает удобные и безопасные солнцезащитные очки. Надежная технология и система контроля качества, история которой насчитывает более 75 лет . Многие солнцезащитные очки, изготовленные с использованием наших собственных технологий, обладают идеальным балансом функции, дизайна и цены. AXe продолжает создавать продукты, подходящие для таких видов спорта, как гольф, рыбалка, бег и вождение. Отныне AX и дальше будет защищать глаза тех, кто им активно пользуется.', 'ФУНКЦИИ СОЛНЦЕЗАЩИТНЫЕ ОЧКИ', '', 'publish', 'closed', 'closed', '', '638', '', '', '2021-04-24 01:16:48', '2021-04-23 22:16:48', '', 0, 'http://axe/?post_type=articles&#038;p=638', 0, 'articles', '', 0),
