INSERT INTO `wp_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`, `layout`, `image`, `is_deleted`, `icon`) VALUES
	(1, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Connect to WooCommerce.com', 'Connect to get important product notifications and updates.', '{}', 'unactioned', 'woocommerce-admin', '2021-03-14 16:09:53', NULL, 0, 'plain', '', 0, 'info'),
	(2, 'wc-admin-onboarding-email-marketing', 'info', 'en_US', 'Sign up for tips, product updates, and inspiration', 'We\'re here for you - get tips, product updates and inspiration straight to your email box', '{}', 'unactioned', 'woocommerce-admin', '2021-03-14 16:09:55', NULL, 0, 'plain', '', 0, 'info'),
	(3, 'wc-admin-marketing-intro', 'info', 'en_US', 'Connect with your audience', 'Grow your customer base and increase your sales with marketing tools built for WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2021-03-14 16:09:55', NULL, 0, 'plain', '', 0, 'info'),
	(4, 'facebook_pixel_api_2021', 'marketing', 'en_US', 'Improve the performance of your Facebook ads', 'Enable Facebook Pixel and Conversions API through the latest version of Facebook for WooCommerce for improved measurement and ad targeting capabilities.', '{}', 'pending', 'woocommerce.com', '2021-02-22 13:09:55', NULL, 0, 'plain', '', 0, 'info'),
	(5, 'facebook_ec_2021', 'marketing', 'en_US', 'Sync your product catalog with Facebook to help boost sales', 'A single click adds all products to your Facebook Business Page shop. Product changes are automatically synced, with the flexibility to control which products are listed.', '{}', 'pending', 'woocommerce.com', '2021-02-22 13:09:55', NULL, 0, 'plain', '', 0, 'info'),
	(6, 'ecomm-need-help-setting-up-your-store', 'info', 'en_US', 'Need help setting up your Store?', 'Schedule a free 30-min <a href="https://wordpress.com/support/concierge-support/">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.', '{}', 'pending', 'woocommerce.com', '2021-02-22 13:09:55', NULL, 0, 'plain', '', 0, 'info'),
	(7, 'woocommerce-services', 'info', 'en_US', 'WooCommerce Shipping & Tax', 'WooCommerce Shipping &amp; Tax helps get your store “ready to sell” as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.', '{}', 'pending', 'woocommerce.com', '2021-02-22 13:09:55', NULL, 0, 'plain', '', 0, 'info'),
	(8, 'ecomm-unique-shopping-experience', 'info', 'en_US', 'For a shopping experience as unique as your customers', 'Product Add-Ons allow your customers to personalize products while they’re shopping on your online store. No more follow-up email requests—customers get what they want, before they’re done checking out. Learn more about this extension that comes included in your plan.', '{}', 'pending', 'woocommerce.com', '2021-02-22 13:09:55', NULL, 0, 'plain', '', 0, 'info'),
	(9, 'wc-admin-getting-started-in-ecommerce', 'info', 'en_US', 'Getting Started in eCommerce - webinar', 'We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.', '{}', 'pending', 'woocommerce.com', '2021-02-22 13:09:55', NULL, 0, 'plain', '', 0, 'info'),
	(10, 'your-first-product', 'info', 'en_US', 'Your first product', 'That\'s huge! You\'re well on your way to building a successful online store — now it’s time to think about how you\'ll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href="https://href.li/?https://woocommerce.com/shipping" target="_blank">WooCommerce Shipping</a>.', '{}', 'unactioned', 'woocommerce.com', '2021-02-24 21:59:07', NULL, 0, 'plain', '', 0, 'info'),
	(11, 'wc-square-apple-pay-boost-sales', 'marketing', 'en_US', 'Boost sales with Apple Pay', 'Now that you accept Apple Pay® with Square you can increase conversion rates by letting your customers know that Apple Pay® is available. Here’s a marketing guide to help you get started.', '{}', 'pending', 'woocommerce.com', '2021-02-22 13:09:55', NULL, 0, 'plain', '', 0, 'info'),
	(12, 'wc-square-apple-pay-grow-your-business', 'marketing', 'en_US', 'Grow your business with Square and Apple Pay ', 'Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay®.', '{}', 'pending', 'woocommerce.com', '2021-02-22 13:09:55', NULL, 0, 'plain', '', 0, 'info'),
	(13, 'wc-admin-optimizing-the-checkout-flow', 'info', 'en_US', 'Optimizing the checkout flow', 'It\'s crucial to get your store\'s checkout as smooth as possible to avoid losing sales. Let\'s take a look at how you can optimize the checkout experience for your shoppers.', '{}', 'unactioned', 'woocommerce.com', '2021-03-06 00:43:16', NULL, 0, 'plain', '', 0, 'info'),
	(14, 'wc-admin-first-five-things-to-customize', 'info', 'en_US', 'The first 5 things to customize in your store', 'Deciding what to start with first is tricky. To help you properly prioritize, we\'ve put together this short list of the first few things you should customize in WooCommerce.', '{}', 'unactioned', 'woocommerce.com', '2021-02-27 22:04:57', NULL, 0, 'plain', '', 0, 'info'),
	(15, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', 'Выбираете тему?', 'Узнайте, какие темы совместимы с WooCommerce и выберите ту, что лучше подойдёт под стиль и требования вашего бизнеса.', '{}', 'unactioned', 'woocommerce-admin', '2021-03-15 16:11:02', NULL, 0, 'plain', '', 0, 'info'),
	(16, 'wc-admin-insight-first-product-and-payment', 'survey', 'en_US', 'Совет', 'Более 80% новых продавцов добавляют первый товар и настраивают хотя бы один способ оплаты в первую неделю. Мы всегда готовы помочь вам развивать бизнес! Вам пригодилась эта информация?', '{}', 'unactioned', 'woocommerce-admin', '2021-03-15 16:11:02', NULL, 0, 'plain', '', 0, 'info'),
	(17, 'wc-admin-learn-more-about-variable-products', 'info', 'en_US', 'Узнать больше о вариативных товарах', 'Вариативный товар - это мощный тип товара, который позволяет вам предлагать набор различных вариантов продукта, которые могут отличаться по ценам, иметь разные изображения, фиксировать складские остатки каждой вариации. Их можно использовать для таких товаров, как рубашка, которая имеет различные размеры и цвета.', '{}', 'unactioned', 'woocommerce-admin', '2021-03-16 09:59:07', NULL, 0, 'plain', '', 0, 'info'),
	(18, 'wc-admin-mobile-app', 'info', 'en_US', 'Установите мобильное приложение Woo', 'Установите мобильное приложение WooCommerce для управления заказами, получения уведомлений о продажах и просмотра ключевых показателей — где бы вы ни находились.', '{}', 'unactioned', 'woocommerce-admin', '2021-03-19 07:04:56', NULL, 0, 'plain', '', 0, 'info'),
	(19, 'wc-admin-need-some-inspiration', 'info', 'en_US', 'Просмотрите наши истории успеха', 'Узнайте больше о том, как другие предприниматели использовали WooCommerce для создания успешного бизнеса.', '{}', 'unactioned', 'woocommerce-admin', '2021-03-19 07:04:56', NULL, 0, 'plain', '', 0, 'info'),
	(20, 'wc-admin-online-clothing-store', 'info', 'en_US', 'Запустите свой магазин одежды', 'Запускать веб-сайт о моде интересно, но требует много сил. В этой статье мы поможем вам преодолеть процесс настройки шаг за шагом, научим создавать списки товаров и покажем, как привлечь нужных посетителей.', '{}', 'unactioned', 'woocommerce-admin', '2021-03-19 07:04:56', NULL, 0, 'plain', '', 0, 'info'),
	(21, 'wc-admin-draw-attention', 'info', 'en_US', 'Выделяйтесь: узнайте, как привлечь внимание к своему интернет-магазину', 'Вот семь способов повысить продажи и не уступать клиентов конкурентам с похожими товарами массового производства. Это поможет вам сделать первые шаги.', '{}', 'unactioned', 'woocommerce-admin', '2021-03-19 07:04:56', NULL, 0, 'plain', '', 0, 'info'),
	(22, 'wc-admin-customizing-product-catalog', 'info', 'en_US', 'Как настроить каталог товаров', 'Вы хотите, чтобы ваш каталог товаров с изображениями выглядели великолепно и соответствовали вашему бренду. Это руководство даст вам все необходимые советы, чтобы ваши продукты отлично смотрелись в вашем магазине.', '{}', 'actioned', 'woocommerce-admin', '2021-03-19 01:04:56', NULL, 0, 'plain', '', 0, 'info'),
	(23, 'wcpay-apple-pay-boost-sales', 'marketing', 'en_US', 'Boost sales with Apple Pay', 'Now that you accept Apple Pay® with WooCommerce Payments you can increase conversion rates by letting your customers know that Apple Pay® is available. Here’s a marketing guide to help you get started.', '{}', 'pending', 'woocommerce.com', '2021-03-01 14:17:51', NULL, 0, 'plain', '', 0, 'info'),
	(24, 'wcpay-apple-pay-grow-your-business', 'marketing', 'en_US', 'Grow your business with WooCommerce Payments and Apple Pay', 'Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay®.', '{}', 'pending', 'woocommerce.com', '2021-03-01 14:17:51', NULL, 0, 'plain', '', 0, 'info'),
	(25, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', 'Помогите WooCommerce стать лучше, согласившись делиться данными об использовании.', 'Сбор данных об использовании позволяет нам улучшить WooCommerce. Информация о вашем магазине будет использоваться для оценки новых функций, определения качества обновлений и принятия решений о целесообразности дальнейших улучшений. Вы всегда можете зайти в <a href="http://10.6.0.2:81/axe/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com" target="_blank">Настройки</a> и выбрать отмену отправки ваших данных. <a href="https://woocommerce.com/usage-tracking" target="_blank">Читать подробнее</a> о том, какие данные мы собираем.', '{}', 'unactioned', 'woocommerce-admin', '2021-03-21 16:10:09', NULL, 0, 'plain', '', 0, 'info'),
	(26, 'wc-admin-store-notice-giving-feedback-2', 'info', 'en_US', 'Приглашаем вас поделиться опытом', 'Теперь, когда мы стали вашим партнером, мы постараемся обеспечить вас всеми необходимыми инструментами. Ждем ваш отзыв о процессе настройки магазина. Он поможет нам оптимизировать его в будущем.', '{}', 'unactioned', 'woocommerce-admin', '2021-03-22 16:11:20', NULL, 0, 'plain', '', 0, 'info'),
	(27, 'wc-admin-insight-first-sale', 'survey', 'en_US', 'Знаете ли вы?', 'В среднем магазину на базе WooCommerce требуется 31 день, чтобы получить первый заказ. Вы на правильном пути! Вам пригодилась эта информация?', '{}', 'unactioned', 'woocommerce-admin', '2021-03-22 16:11:20', NULL, 0, 'plain', '', 0, 'info'),
	(28, 'wc-admin-coupon-page-moved', 'update', 'en_US', 'Мы перенесли управление купонами.', 'Теперь управлять купонами можно в разделе Маркетинг &gt; Купоны. Нажмите кнопку ниже, чтобы удалить устаревший элемент меню WooCommerce &gt; Купоны.', '{}', 'actioned', 'woocommerce-admin', '2021-03-23 14:49:20', NULL, 0, 'plain', '', 0, 'info'),
	(29, 'wc-admin-customize-store-with-blocks', 'info', 'en_US', 'Настраивайте свой онлайн-магазин с помощью блоков WooCommerce', 'С помощью блоков можно отображать выбранные товары, категории, фильтры и другие элементы почти в любом месте сайта без шорткодов и изменения кода. Узнайте больше о том, как пользоваться каждым из них.', '{}', 'unactioned', 'woocommerce-admin', '2021-03-28 16:10:55', NULL, 0, 'plain', '', 0, 'info'),
	(30, 'wcpay-apple-pay-is-now-available', 'marketing', 'en_US', 'Apple Pay is now available with WooCommerce Payments!', 'Increase your conversion rate by offering a fast and secure checkout with <a href="https://woocommerce.com/apple-pay/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay" target="_blank">Apple Pay</a>®. It’s free to get started with <a href="https://woocommerce.com/payments/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay" target="_blank">WooCommerce Payments</a>.', '{}', 'pending', 'woocommerce.com', '2021-03-21 01:10:41', NULL, 0, 'plain', '', 0, 'info'),
	(31, 'paypal_ppcp_gtm_2021', 'marketing', 'en_US', 'Offer more options with the new PayPal', 'Get the latest PayPal extension for a full suite of payment methods with extensive currency and country coverage.', '{}', 'pending', 'woocommerce.com', '2021-03-22 04:10:55', NULL, 0, 'plain', '', 0, 'info'),
	(32, 'wc-admin-filter-by-product-variations-in-reports', 'info', 'en_US', 'Новинка: фильтрация по вариациям товаров в заказах и отчёты о товарах', 'Стала доступна одна из самых долгожданных функций! Теперь у вас есть информация обо всех вариациях товаров в заказах и отчёты о товарах.', '{}', 'unactioned', 'woocommerce-admin', '2021-04-05 16:11:04', NULL, 0, 'banner', 'http://axe/wp-content/plugins/woocommerce/packages/woocommerce-admin/images/admin_notes/filter-by-product-variations-note.svg', 0, 'info'),
	(34, 'wc-payments-qualitative-feedback', 'info', 'en_US', 'WooCommerce Payments setup - let us know what you think', 'Congrats on enabling WooCommerce Payments for your store. Please share your feedback in this 2 minute survey to help us improve the setup process.', '{}', 'pending', 'woocommerce.com', '2021-04-12 01:10:00', NULL, 0, 'plain', '', 0, 'info'),
	(36, 'wc-admin-new-sales-record', 'info', 'en_US', 'Новый рекорд продаж!', 'Ого, April 18th был вашим рекордным днем по продажам! Чистый объем продаж245500.00₽ побил предыдущий рекорд 8500.00₽ установленный на April 6th.', '{"old_record_date":"2021-04-06","old_record_amt":8500,"new_record_date":"2021-04-18","new_record_amt":245500}', 'unactioned', 'woocommerce-admin', '2021-04-19 16:10:28', NULL, 0, 'plain', '', 0, 'info'),
	(37, 'wc-admin-orders-milestone', 'info', 'en_US', 'Поздравляем с обработкой 100 заказов!', 'Очередной этап заказа. Посмотрите на отчёт о заказах, в котором собраны все ваши заказы за день.', '{}', 'unactioned', 'woocommerce-admin', '2021-04-22 20:10:27', NULL, 0, 'plain', '', 0, 'info'),
	(38, 'share-your-feedback-on-paypal', 'info', 'en_US', 'Share your feedback on PayPal', 'Share your feedback in this 2 minute survey about how we can make the process of accepting payments more useful for your store.', '{}', 'pending', 'woocommerce.com', '2021-05-13 11:46:55', NULL, 0, 'plain', '', 0, 'info'),
	(39, 'wcpay_instant_deposits_gtm_2021', 'marketing', 'en_US', 'Get paid within minutes – Instant Deposits for WooCommerce Payments', 'Stay flexible with immediate access to your funds when you need them – including nights, weekends, and holidays. With <a href="https://woocommerce.com/products/woocommerce-payments/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_instant_deposits">WooCommerce Payments\'</a> new Instant Deposits feature, you’re able to transfer your earnings to a debit card within minutes.', '{}', 'pending', 'woocommerce.com', '2021-05-13 11:46:55', NULL, 0, 'plain', '', 0, 'info'),
	(40, 'wc-subscriptions-security-update-3-0-15', 'info', 'en_US', 'WooCommerce Subscriptions security update!', 'We recently released an important security update to WooCommerce Subscriptions. To ensure your site\'s data is protected, please upgrade <strong>WooCommerce Subscriptions to version 3.0.15</strong> or later.<br /><br />Click the button below to view and update to the latest Subscriptions version, or log in to <a href="https://woocommerce.com/my-dashboard">WooCommerce.com Dashboard</a> and navigate to your <strong>Downloads</strong> page.<br /><br />We recommend always using the latest version of WooCommerce Subscriptions, and other software running on your site, to ensure maximum security.<br /><br />If you have any questions we are here to help — just <a href="https://woocommerce.com/my-account/create-a-ticket/">open a ticket</a>.', '{}', 'pending', 'woocommerce.com', '2021-06-03 21:11:29', NULL, 0, 'plain', '', 0, 'info'),
	(41, 'wc-admin-real-time-order-alerts', 'info', 'en_US', 'Получайте уведомления о новых заказах в реальном времени, где бы вы ни находились', 'Получайте уведомления об активности в магазине, в том числе о размещении новых заказов и отзывов о товарах, прямо на мобильные устройства благодаря приложению Woo.', '{}', 'unactioned', 'woocommerce-admin', '2021-07-05 20:12:55', NULL, 0, 'plain', '', 0, 'info'),
	(42, 'eu_vat_changes_2021', 'marketing', 'en_US', 'Get your business ready for the new EU tax regulations', 'On July 1, 2021, new taxation rules will come into play when the <a href="https://ec.europa.eu/taxation_customs/business/vat/modernising-vat-cross-border-ecommerce_en">European Union (EU) Value-Added Tax (VAT) eCommerce package</a> takes effect.<br /><br />The new regulations will impact virtually every B2C business involved in cross-border eCommerce trade with the EU.<br /><br />We therefore recommend <a href="https://woocommerce.com/posts/new-eu-vat-regulations">familiarizing yourself with the new updates</a>, and consult with a tax professional to ensure your business is following regulations and best practice.', '{}', 'unactioned', 'woocommerce.com', '2021-07-05 02:12:56', NULL, 0, 'plain', '', 0, 'info'),
	(43, 'google_listings_and_ads_install', 'marketing', 'en_US', 'Drive traffic and sales with Google', 'Reach online shoppers to drive traffic and sales for your store by showcasing products across Google, for free or with ads.', '{}', 'unactioned', 'woocommerce.com', '2021-07-05 02:12:56', NULL, 0, 'plain', '', 0, 'info'),
	(44, 'woocommerce-core-update-5-4-0', 'info', 'en_US', 'Update to WooCommerce 5.4.1 now', 'WooCommerce 5.4.1 addresses a checkout issue discovered in WooCommerce 5.4. We recommend upgrading to WooCommerce 5.4.1 as soon as possible.', '{}', 'pending', 'woocommerce.com', '2021-07-05 02:12:56', NULL, 0, 'plain', '', 0, 'info'),
	(45, 'wcpay-promo-2020-11', 'marketing', 'en_US', 'wcpay-promo-2020-11', 'wcpay-promo-2020-11', '{}', 'pending', 'woocommerce.com', '2021-07-05 02:12:56', NULL, 0, 'plain', '', 0, 'info'),
	(46, 'wcpay-promo-2020-12', 'marketing', 'en_US', 'wcpay-promo-2020-12', 'wcpay-promo-2020-12', '{}', 'pending', 'woocommerce.com', '2021-07-05 02:12:56', NULL, 0, 'plain', '', 0, 'info'),
	(47, 'wcpay-promo-2021-6-incentive-1', 'marketing', 'en_US', 'Simplify the payments process for you and your customers with WooCommerce Payments', 'With <a href="https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601">WooCommerce Payments</a>, you can securely accept all major cards, Apple Pay®, and recurring revenue in over 100 currencies. \n				Built into your store’s WooCommerce dashboard, track cash flow and manage all of your transactions in one place – with no setup costs or monthly fees.\n				<br /><br />\n				By clicking "Get WooCommerce Payments," you agree to the <a href="https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601">Terms of Service</a> \n				and acknowledge you have read the <a href="https://automattic.com/privacy/">Privacy Policy</a>.\n				', '{}', 'pending', 'woocommerce.com', '2021-07-05 02:12:56', NULL, 0, 'plain', '', 0, 'info'),
	(48, 'wcpay-promo-2021-6-incentive-2', 'marketing', 'en_US', 'Simplify the payments process for you and your customers with WooCommerce Payments', 'With <a href="https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601">WooCommerce Payments</a>, you can securely accept all major cards, Apple Pay®, and recurring revenue in over 100 currencies. \n				Built into your store’s WooCommerce dashboard, track cash flow and manage all of your transactions in one place – with no setup costs or monthly fees.\n				<br /><br />\n				By clicking "Get WooCommerce Payments," you agree to the <a href="https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601">Terms of Service</a> \n				and acknowledge you have read the <a href="https://automattic.com/privacy/">Privacy Policy</a>.\n				', '{}', 'pending', 'woocommerce.com', '2021-07-05 02:12:56', NULL, 0, 'plain', '', 0, 'info'),
	(49, 'ppxo-pps-upgrade-paypal-payments-1', 'info', 'en_US', 'Get the latest PayPal extension for WooCommerce', 'Heads up! There\'s a new PayPal on the block!<br /><br />Now is a great time to upgrade to our latest <a href="https://woocommerce.com/products/woocommerce-paypal-payments/" target="_blank">PayPal extension</a> to continue to receive support and updates with PayPal.<br /><br />Get access to a full suite of PayPal payment methods, extensive currency and country coverage, and pay later options with the all-new PayPal extension for WooCommerce.', '{}', 'unactioned', 'woocommerce.com', '2021-07-05 02:12:56', NULL, 0, 'plain', '', 0, 'info'),
	(50, 'ppxo-pps-upgrade-paypal-payments-2', 'info', 'en_US', 'Upgrade your PayPal experience!', 'We\'ve developed a whole new <a href="https://woocommerce.com/products/woocommerce-paypal-payments/" target="_blank">PayPal extension for WooCommerce</a> that combines the best features of our many PayPal extensions into just one extension.<br /><br />Get access to a full suite of PayPal payment methods, extensive currency and country coverage, offer subscription and recurring payments, and the new PayPal pay later options.<br /><br />Start using our latest PayPal today to continue to receive support and updates.', '{}', 'pending', 'woocommerce.com', '2021-07-05 02:12:56', NULL, 0, 'plain', '', 0, 'info'),
	(51, 'wayflyer_q3_2021', 'marketing', 'en_US', 'Grow your revenue with Wayflyer financing and analytics', 'Flexible financing tailored to your needs by <a href="https://woocommerce.com/products/wayflyer/">Wayflyer</a> – one fee, no interest rates, penalties, equity, or personal guarantees. Based on your store\'s performance, Wayflyer can provide the financing you need to grow and the analytical insights to help you spend it.', '{}', 'pending', 'woocommerce.com', '2021-07-19 17:16:23', NULL, 0, 'plain', '', 0, 'info'),
	(52, 'woocommerce-core-sqli-july-2021-need-to-update', 'update', 'en_US', 'Action required: Critical vulnerabilities in WooCommerce', 'In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.', '{}', 'pending', 'woocommerce.com', '2021-07-19 17:16:23', NULL, 0, 'plain', '', 0, 'info'),
	(53, 'woocommerce-blocks-sqli-july-2021-need-to-update', 'update', 'en_US', 'Action required: Critical vulnerabilities in WooCommerce Blocks', 'In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.', '{}', 'pending', 'woocommerce.com', '2021-07-19 17:16:23', NULL, 0, 'plain', '', 0, 'info'),
	(54, 'woocommerce-core-sqli-july-2021-store-patched', 'update', 'en_US', 'Solved: Critical vulnerabilities patched in WooCommerce', 'In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.', '{}', 'pending', 'woocommerce.com', '2021-07-19 17:16:23', NULL, 0, 'plain', '', 0, 'info'),
	(55, 'woocommerce-blocks-sqli-july-2021-store-patched', 'update', 'en_US', 'Solved: Critical vulnerabilities patched in WooCommerce Blocks', 'In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.', '{}', 'pending', 'woocommerce.com', '2021-07-19 17:16:23', NULL, 0, 'plain', '', 0, 'info');
